import React, { Component } from 'react';
import PropTypes from 'prop-types'
import "../App.css"

class TodoSubList extends Component {


    const
    render() {
        return (
            <div>
                <div className="item1-container">{this.props.todosublist.steps}</div>
                <div className="item2-container">{this.props.todosublist.task}</div>
                <div className="item3-container">{this.props.todosublist.task}</div>
            </div>
        )

    }

}


TodoSubList.propTypes = {
    todosublist: PropTypes.array.isRequired
}
export default TodoSubList;
